INSERT INTO `note` (`id`, `note_no`, `note`, `is_active`, `is_deleted`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 1, 'Requires modification to the OEM steering knuckle', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(2, 2, 'Requires modification to the OEM steering knuckle and use of included custom hubs', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(3, 3, '1995 E36 M3 models require minor modification to the lower control arm outboard of the ball joint', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(4, 4, 'This system consists of 2-Piece disc assemblies which directly replace the OEM discs', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(5, 5, 'Requires significant modification to the OEM knuckle', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(6, 6, 'NOT FOR ROAD USE. This system eliminates the parking/emergency brake function if not used in conjunction with parking brake kit', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(7, 7, 'NOT FOR ROAD USE. This system eliminates the parking/emergency brake function', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(8, 8, 'This system is to be used ONLY with OEM rear brakes, not to be used with the rear upgrade kit', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(9, 9, 'Special order only, additional charges and lead-time may apply', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(10, 10, 'This system does not include brake lines, the OEM brake lines are retained', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(11, 11, 'This system can be fitted to CCM-equipped models, however the original hand-brake calipers cannot be used.  The hand-brake calipers from an iron brake model must be obtained and used instead.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(12, 12, 'This system includes oversized 2-Piece disc assemblies, brackets, and hardware to be used with the OEM calipers.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(13, 13, 'For use only with 405mm M6 front brake system', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(14, 14, 'For applications for PCCB equipped models, please contact your distributor', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(15, 15, 'Caliper upgrade only.  This system includes calipers, brackets, brake lines and hardware to be used in conjunction with the original discs.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(16, 16, 'This system consists of 2-Piece disc assemblies which directly replace the OEM discs. To be used with OEM calipers.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(17, 17, 'This system consists of 2-Piece disc assemblies and brake pads which directly replace the OEM discs and pads.  To be used with OEM calipers.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(18, 18, 'NOT FOR ROAD USE.  This system consists of 2-Piece disc assemblies which directly replace the OEM discs.  Must be used with 17.5mm pad thickness. To be used with OEM calipers.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(19, 19, 'The crossection and A, B, C dimensions reflect the dimensions of the 4-piston caliper and not the hand-brake caliper.  The maximum radial dimension occurs at the relocated hand-brake caliper, so this must be factored in when choosing a wheel to fit the complete system.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(20, 20, 'This system includes oversized 2-Piece disc assemblies and new brake pads to be used with the OEM calipers.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(21, 21, 'This system includes oversized 2-Piece disc assemblies, brake pads, brackets, and hardware to be used with the OEM calipers.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(22, 22, 'Brembo GT Systems are designed for vehicles at original ride height.  Increased ride height is not compatible with the brake lines included in these systems.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(23, 23, 'The disc bells in this system are finished in natural hard anodize, exhibiting a greyish color, different from the black used on most GT systems.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(24, 24, '…..', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(25, 25, 'It is not mandatory for kit fitting, however, proportioning valve in rear brake circuit can be replaced with version from Porsche 964 cars originally equipped with 4-piston rear calipers for increased rear brake bias.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(26, 26, 'Heavy-duty disc with smaller airgap', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(27, 27, 'NOT FOR ROAD USE.  This system consists of 2-Piece disc assemblies which directly replace the OEM discs. To be used with OEM calipers.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(28, 28, 'Only for use with 1M1/2.8054A front kit, not to be used with 1A1/2.6016A.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(29, 29, 'This system consists of CCM-R discs assemblies and brake pads which directly replace the OEM discs and pads. Note that this system could be fitted to 2012+ models if used with calipers from 2009-2011 model years.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(30, 30, 'This system consists of CCM-R discs assemblies and brake pads which directly replace the OEM discs and pads.', 1, 0, '2022-03-07 20:42:49', '2022-03-07 20:42:49', NULL),
(31, 31, '…..', 1, 0, '2022-03-07 20:42:50', '2022-03-07 20:42:50', NULL),
(32, 32, 'This system includes mechanical parking/emergency brake calipers.', 1, 0, '2022-03-07 20:42:50', '2022-03-07 20:42:50', NULL),
(33, 33, 'This system reduces wheel offset (i.e. moves the wheel outboard) by 3.5mm.', 1, 0, '2022-03-07 20:42:50', '2022-03-07 20:42:50', NULL),
(34, 34, 'This system consists of smaller (380mm vs. 410mm) 2-Piece iron disc assemblies which replace the OEM PCCB discs. To be used with OEM calipers. Includes new caliper adapter brackets, brake pads, and brake hardlines.', 1, 0, '2022-03-07 20:42:50', '2022-03-07 20:42:50', NULL),
